import { useNavigate } from 'react-router-dom';
import Translations from "../constants/Translations";

import {dictNavigationBarIcon} from "../constants/NavigationBarIcon";
import routes from '../routes/routes';

import {setLanguage} from '../redux/languageSlice';
import {useSelector} from "react-redux";

import '../componentsStyles/NavigationBar.css';

const components = [ 'Discovery', 'Tickets', 'Home', 'QrCode', 'Informations'];

const ROUTES = ['discovery', 'tickets', 'home', 'qrcode', 'informations'];

const images = [dictNavigationBarIcon.discovery,
                            dictNavigationBarIcon.tickets,
                            dictNavigationBarIcon.home,
                            dictNavigationBarIcon.qrcode,
                            dictNavigationBarIcon.informations];


function NavigationBar(props) {
    const theLanguage = useSelector(state => state.language);
    const dict = Translations();
    const navigate = useNavigate(); // Add this line
    return (
        <>
            <div className="navigation-bar">

                <button  onClick={() => navigate(ROUTES[0])}>
                    <ul>
                        <li>
                            <img src={images[0]} alt="Discovery"/>
                        </li>
                        <li>
                            {dict.homeD[theLanguage]}
                        </li>
                    </ul>
                </button>

                <button onClick={() => navigate(ROUTES[1])}>
                    <ul>
                        <li>
                            <img src={images[1]} alt="Tickets"/>
                        </li>
                        <li>
                           {dict.componentsD[theLanguage]}
                        </li>
                    </ul>
                </button>

                <button onClick={() => navigate(ROUTES[2])}>
                    <ul>
                        <li>
                            <img src={images[2]} alt="Home"/>
                        </li>
                        <li>
                            {dict.homeD}
                        </li>
                    </ul>
                </button>

                <button onClick={() => navigate(ROUTES[3])}>
                    <ul>
                        <li>
                            <img src={images[3]} alt="Qrcode"/>
                        </li>
                        <li>
                            {dict.qrCodeD}
                        </li>
                    </ul>
                </button>

                <button onClick={() => navigate(ROUTES[4])}>
                    <ul >
                        <li>
                            <img src={images[4]} alt="Informations"/>
                        </li>
                        <li>
                            {dict.informationsD}
                        </li>
                    </ul>
                </button>

            </div>
        </>
    );
}


export default NavigationBar;
